import React,{Component} from 'react';
import {withRouter} from 'react-router-dom';
import axios from 'axios';

class SearchList extends Component{
    componentDidMount(){
        let kw = this.props.keyWord;
        console.log(kw);
        axios.get('/myapi/wapapi/searchshows.do',{
            params:{
                cityid:1,
                kw:kw,
                page:1,
                sign:'1ef59d37454f6ea3ab',
                time:1544148448
            }
        }).then(res=>{
            let data = res.data.datas;
            console.log(data)  
            this.setState({
                result:data,
            });
        });
    }
    render(){
        console.log()
        return <div className="searchList">
           
        </div>
    }
}

SearchList = withRouter(SearchList)
